2012-12-21 mikedreams on... My winnings on Schlag del Rey.

Did I forget to mention that aside from the usual string section, there is a band playing, too? Lana and some drums, man! Like on the album. Oh, this sweet deep roll rocks.

&quot;I am alone in midnight&quot; - LDR

Briefest day of the year is long on the lone shining musical star in the night sky of the year here in America.

My Only Album, Single, EP and Everything Artist of the Year - Lana Del Rey of flight so bright, oh sing that body electric bird of paradise.

F-U-S-A! &quot;...Like an American...&quot; If they don't like it, they will never ever even get their own loss.

They can have their oh so cute &quot;posing as a real singer&quot; swift shit. I wake and break to an everlasting belt from heavenly hello, belle air of del yayo.

LDR: 2013 NME Awards (nominated) - Hottest Woman in Music 2012.

LDR: &quot;Let's get outta this town/ We're on fire...&quot;

Oh, what fun is to ride in a one-horse clown town going down for the count I wish to the out of earshot hot bliss beat of whatever Kyrie Del Rey is on.


